css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("youtube.com"),
		domain("myspace.com"),
		domain("metacafe.com"),
		domain("break.com"),
		domain("putfile.com"),
		domain("dailymotion.com"),
                domain("clipfish.de"),
                domain("myvideo.de"),
                domain("sevenload.com"),
                domain("video.google.com"),
domain("userstyles.org")
{

body { background: url(http://www.gamereplays.org/community/uploads/post-91942-1221841140.jpg);
}
p{ color: #ffffff;
}
b{ color: #000ccc;
}
h1, h2, h3, h, h5, h6{ color: #000ccc;
}
/* Dark Grey Carbon background */
#all-in-one-video-bookmarklet {
	background: #333 url("data:image/jpg;base64,") repeat !important;
	color: #ddd !important;
}

/* Common to All links */
a { text-decoration: none !important; }

a:link,
a.q:visited, 
a.toplink:visited {
	color: #82BDFF !important; /* lightblue */
	text-decoration: none !important; 
}

a:link:hover {
	color: #ff6600 !important; /* darkorange */
}

a:visited { 
	color: #33FFFF !important; /* greenishhigh */
}

a:hover, 
a:visited:hover {
  color: #1689FF !important; /* mediumblue */
 }


/* download page */
#all-in-one-video-bookmarklet > DIV { 
        background-color : #000 !important; 
}

#all-in-one-video-bookmarklet > DIV > H1,
#all-in-one-video-bookmarklet > DIV > DIV:first-child + H1 + H2,
#all-in-one-video-bookmarklet > DIV > DIV:first-child + H1 + H2 + UL + P,
#all-in-one-video-bookmarklet > DIV > DIV:first-child + H1 + H2 + UL + P + P + H2,
#all-in-one-video-bookmarklet > DIV > DIV:first-child + H1 + H2 + UL + P + P + H2 + P { 
        border-color: #666 !important; 
}

.logoimgtop {
        width: 0 !important;
	height: 58px !important;
        padding-left: 86px !important;
        background-image: url(data:image/png;base64,) !important;
}


.logoimgbottom {
        width: 0 !important;
	height: 24px !important;
        padding-left: 111px !important;
        background-image: url(data:image/png;base64,) !important;
}
}
